                    celda.Add(tableBlanco);

                    tableDocumento.AddCell(celda);

                    table = CrearTabla(1, 100, 0, null, true, true, true, true);

                    celda = new Cell(0, 0);
                    celda.SetBorder(Border.NO_BORDER);
                    celda.SetPadding(0);

                    AgregarParrafo(table, $"RESOLUCIÓN DIAN N° {factura.Res.Resolucion}", colorLetra, 8, true, TextAlignment.CENTER, 0, 0, 100, false, false, false, false, 0, null, VerticalAlignment.MIDDLE);
                    AgregarParrafo(table, $"FECHA {factura.Res.Fecha:dd/MM/yyyy}, DESDE {factura.Res.InicioNumeracion} HASTA {factura.Res.FinNumeracion}", colorLetra, 8, true, TextAlignment.CENTER, 0, 0, 100, false, false, false, false, 0, null, VerticalAlignment.MIDDLE);
                    AgregarParrafo(table, "FACTURA IMPRESA POR COMPUTADOR", colorLetra, 8, true, TextAlignment.CENTER, 0, 0, 100, false, false, false, false, 0, null, VerticalAlignment.MIDDLE);

                    celda.Add(table);

                    tableDocumento.AddCell(celda);

                    celda = new Cell(0, 0);
                    celda.SetBorder(Border.NO_BORDER);
                    celda.SetPadding(0);

                    celda.Add(tableBlanco);

                    tableDocumento.AddCell(celda);

                    table = CrearTabla(1, 100, 0, null, true, true, true, true);

                    celda = new Cell(0, 0);
                    celda.SetBorder(Border.NO_BORDER);
                    celda.SetPadding(0);

                    AgregarParrafo(table, "VISITENOS EN WWW.COORDINADORA.COM", colorLetra, 8, true, TextAlignment.CENTER, 0, 0, 100, false, false, false, false, 0, null, VerticalAlignment.MIDDLE);
                    AgregarParrafo(table, "LINEA DE ATENCION AL CLIENTE 01 8000 520 555", colorLetra, 8, true, TextAlignment.CENTER, 0, 0, 100, false, false, false, false, 0, null, VerticalAlignment.MIDDLE);
                    
                    celda.Add(table);

                    tableDocumento.AddCell(celda);

                    celda = new Cell(0, 0);
                    celda.SetBorder(Border.NO_BORDER);
                    celda.SetPadding(0);

                    celda.Add(tableBlanco);

                    tableDocumento.AddCell(celda);

                    document.Add(tableDocumento);

                    pdfDocument.Close();
                }

                // El nombre de la impresora que desea utilizar.
                var impresora = ConfigurationManager.AppSettings["Impresora"];

                // Cree una instancia de la impresora
                IPrinter printer = new Printer();

                // Imprime el archivo
                printer.PrintRawFile(impresora, rutaArchivo, Path.GetFileNameWithoutExtension(rutaArchivo));
            }
            catch (Exception e)
            {
                Console.WriteLine(e);
                throw;
            }
        }
        
        private static Table CrearTabla(int columnas, float ancho, int padding, HorizontalAlignment? alineacionHorizontal, bool bordeIzquierdo, bool bordeSuperior, bool bordeDerecho, bool bordeInferior)
        {
            var table = new Table(columnas);

            table.SetWidth(UnitValue.CreatePercentValue(ancho));
            table.SetPadding(padding);
            if (!bordeIzquierdo)
            {
                table.SetBorderLeft(Border.NO_BORDER);
            }
            if (!bordeSuperior)
            {
                table.SetBorderTop(Border.NO_BORDER);
            }
            if (!bordeDerecho)
            {
                table.SetBorderRight(Border.NO_BORDER);
            }
            if (!bordeInferior)
            {
                table.SetBorderBottom(Border.NO_BORDER);
            }
            if (alineacionHorizontal != null)
            {
                table.SetHorizontalAlignment(alineacionHorizontal);
            }
            return table;
        }

        private static void AgregarParrafo(Table tabla, string texto, Color colorLetra, int tamanoLetra, bool negrita, TextAlignment alineacion, int rowspan, int colspan, float anchoFila, bool bordeIzquierdo, bool bordeSuperior, bool bordeDerecho, bool bordeInferior, int padding, DeviceRgb colorCelda, VerticalAlignment alineacionVertical)
        {
            if (string.IsNullOrWhiteSpace(texto))
            {
                texto = texto == "\n" ? "." : string.Empty;
            }

            var parrafo = new Paragraph(texto);
            
            PdfFontFactory.Register($"{System.Environment.GetFolderPath(System.Environment.SpecialFolder.Fonts)}/Arial.ttf", "Arial");
            var font = PdfFontFactory.CreateRegisteredFont("Arial");

            parrafo.SetFont(font);
            parrafo.SetFontColor(colorLetra);
            parrafo.SetFontSize(tamanoLetra);
            if (negrita)
            {
                parrafo.SetBold();
            }
            parrafo.SetTextAlignment(alineacion);

            var celda = new Cell(rowspan, colspan);
            if (!bordeIzquierdo)
            {
                celda.SetBorderLeft(Border.NO_BORDER);
            }
            if (!bordeSuperior)
            {
                celda.SetBorderTop(Border.NO_BORDER);
            }
            if (!bordeDerecho)
            {
                celda.SetBorderRight(Border.NO_BORDER);
            }
            if (!bordeInferior)
            {
                celda.SetBorderBottom(Border.NO_BORDER);
            }
            celda.SetWidth(UnitValue.CreatePercentValue(anchoFila));
            celda.SetPadding(padding);
            if (colorCelda != null)
            {
                celda.SetBackgroundColor(colorCelda);
            }
            celda.SetVerticalAlignment(alineacionVertical);
            celda.Add(parrafo);

            tabla.AddCell(celda);
        }

        private static void AgregarImagen(Table tabla, Bitmap imagen, float ancho, float alto, bool autoEscala, HorizontalAlignment? alineacionHorizontal, int rowspan, int colspan, float anchoFila, bool borde, int padding, VerticalAlignment alineacionVertical)
        {
            using (var memoryStream = new MemoryStream())
            {
                var bmp = (Bitmap)imagen.Clone();

                bmp.Save(memoryStream, ImageFormat.Png);

                var image = new Image(ImageDataFactory.Create(memoryStream.ToArray()));

                if (autoEscala)
                {
                    image.SetAutoScale(true);
                }
                else
                {
                    image.SetWidth(ancho);
                    image.SetHeight(alto);
                }

                if (alineacionHorizontal != null)
                {
                    image.SetHorizontalAlignment(alineacionHorizontal);
                }

                var celda = new Cell(rowspan, colspan);
                if (!borde)
                {
                    celda.SetBorder(Border.NO_BORDER);
                }
                celda.SetWidth(UnitValue.CreatePercentValue(anchoFila));
                celda.SetPadding(padding);
                celda.SetVerticalAlignment(alineacionVertical);

                celda.Add(image);

                tabla.AddCell(celda);
            }
        }
    }
